(138, 'DABN-KMH-001', 'KIRBY MORGAN HELMET', 1, 0, 'Unit', 0, 0, 0, '<p>Kirby Morgan Helmet</p>\n\n<ul>\n	<li><strong>CE certified</strong></li>\n	<li><strong>Weight:</strong>&nbsp;Kirby Morgan 18 BandMask&reg; - 13.63 pounds</li>\n	<li><strong>Mask Frame:&nbsp;</strong>Kirby Morgan 18 BandMask&reg;: Fiberglass, polyester resin, polyester gel coat, and carbon fibers</li>\n	<li><strong>Control Knobs</strong>: Polyurathane</li>\n	<li><strong>Lens</strong>: Clear polycarbonate</li>\n	<li><strong>Hood</strong>: Neoprene.</li>\n	<li><strong>O-Rings</strong>: Buna-N</li>\n	<li><strong>Recommended Lubricants</strong>: Christo-Lube&reg; Dow Corning&reg; MS4 Silicone Lubricant. Krytox&reg; and Halocarbon&reg; are also acceptable.</li>\n	<li><strong>Regulator Performance</strong>: Kirby Morgan SuperFlow&reg; 350 Performance. The Kirby Morgan SuperFlow&reg; 350 regulator on the Kirby Morgan 18 and 28 BandMasks&reg; offers high performance. The commercial diving regulator has been tested at Dive Lab at Panama City, Florida. It meets all current U.S. Navy and European commercial diving standards.</li>\n	<li><strong>Cage Code</strong>: The cage code for identifying Kirby Morgan DSI products for U.S. government purposes is 58366.</li>\n	<li><strong>CR Standards</strong>: These masks meet or exceed all standards established by Dive Lab of Panama City, Florida, and are CR (Commercially Rated) marked.</li>\n	<li><strong>CE Approved</strong>: Both the Kirby Morgan 18&reg; and 28&reg; BandMasks&reg; are CE Approved.</li>\n	<li><strong>Temperature Limitations</strong>: Use at water temperatures below 33 degrees Fahrenheit (1 degrees Celsius) requires use of the Kirby Morgan Hot Water Shroud (P/N 525-100) and hot water.</li>\n	<li><strong>Operational Specifications &amp; Limitations</strong>: Commercial Diving Umbilical minimum I.D. 3/8 in. (9.5 mm) of not more than two sections, total length not to exceed 600 feet (183m).&nbsp; This bandmask meets or exceeds all requirements of NPD, Health and Safety, (U.K.), United States Navy, ADCI United States and is CR rated by Dive Lab, Panama City, Fla., USA.&nbsp; Recommended overbottom (OB) gas supply pressure for best performance at depths are calculated by the formula (fsw x 0.445+14.7) + recommended p.s.i.g</li>\n</ul>\n', 325, 'baik', '', '2023-07-27', 'L01.1', 27),
