(281, 'DABN-TAB-001', 'BUCKLEYS', 1, 0, 'Unit', 0, 0, 0, '<p>Buckley&rsquo;s&nbsp; Bathy Corrometer&nbsp;</p>\n\n<ul>\n	<li>Display: 0.001 to -1.999V 3&frac12; digit high-visibility backlit LCD</li>\n	<li>Accuracy: 0.05% typical, instrument calibration accuracy&nbsp;+/- 1mV +/- 1 count</li>\n	<li>Battery charger: 14hr standard 110-230V AC</li>\n	<li>Input impedance: 1M Ohm</li>\n	<li>Operating temperature range 0 to 30&deg;C, temperature stability 100 ppm/&deg;C</li>\n	<li>Operating time on full charge 100hr +</li>\n	<li>Reference electrode: silver/silver chloride</li>\n	<li>Multi-function socket</li>\n	<li>Weight (unit only): in air 2.5Kg, in water 0.85Kg</li>\n	<li>Dimensions (unit only): 10cm x 27.5cm</li>\n	<li>Dimensions (carrying case): 38cm x 49cm x 19cm</li>\n	<li>Packed weight (standard kit): 8.05Kg</li>\n	<li>Dimensions (packed): 39cm x 50cm x 20cm</li>\n</ul>\n', 339, 'baik', '', '2023-07-27', 'L02.4', 27),
(282, 'DABN-TACY-001', 'CYGNUS', 1, 0, 'Unit', 0, 0, 0, '<p>Cygnus M4-UW</p>\n\n<table border=\"1\" cellspacing=\"0\" style=\"width:93.02%\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:white; height:39.75pt; width:30.0%\">\n			<p><strong>Materials</strong></p>\n			</td>\n			<td style=\"background-color:white; height:39.75pt\">\n			<p>Velocities between 2,000 and 7,000 m/s (0.0800 to 0.2780 in/us) &ndash; covers virtually all common engineering materials</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:white; height:40.45pt; width:30.0%\">\n			<p><strong>Measurement Range in Steel</strong></p>\n			</td>\n			<td style=\"background-color:white; height:40.45pt\">\n			<p>1 &ndash; 250 mm (0.040 &ndash; 10 inch) depending on selected probe and configuration, material and temperature</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:white; height:60.0pt; width:30.0%\">\n			<p><strong>Accuracy</strong></p>\n			</td>\n			<td style=\"background-color:white; height:60.0pt\">\n			<p>&plusmn;0.1 mm or 0.1% of thickness measurement, whichever is greatest, when calibrated in accordance with Cygnus Instruments calibration procedure</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:white; height:19.5pt; width:30.0%\">\n			<p><strong>Resolution</strong></p>\n			</td>\n			<td style=\"background-color:white; height:19.5pt\">\n			<p>0.1 or 0.05 mm (selectable) (0.005 or 0.002 inch)</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:white; height:20.25pt; width:30.0%\">\n			<p><strong>Probe Options</strong></p>\n			</td>\n			<td style=\"background-color:white; height:20.25pt\">\n			<p>Single crystal probes</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:white; height:19.5pt; width:30.0%\">\n			<p><strong>Power</strong></p>\n			</td>\n			<td style=\"background-color:white; height:19.5pt\">\n			<p>2 x rechargeable NiMH battery packs</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:white; height:3