(491, 'DABN-TABC-007', 'BOOTISH CORAL BOOT', 1, 0, 'Unit', 0, 0, 0, '<table cellspacing=\"0\" style=\"width:188pt\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"height:15.0pt; vertical-align:middle; white-space:nowrap; width:188pt\">Merk : SCUBAPRO / Delta 5</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:15.0pt; text-align:left; vertical-align:middle; white-space:nowrap\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:15.0pt; text-align:left; vertical-align:middle; white-space:nowrap\">Material&nbsp; : Neoprene 5 mm</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:45.0pt; text-align:left; vertical-align:middle; white-space:normal; width:188pt\">A sturdy outsole and rubberized armor provide excellent protection on both the top and bottom of the boot.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:45.0pt; vertical-align:middle; white-space:normal; width:188pt\">The top of the foot is both cushioned and protected against abrasion from the edge of the fin pocket.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:45.0pt; vertical-align:middle; white-space:normal; width:188pt\">Built-in arch support increases comfort when traversing rocky shorelines.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:60.0pt; vertical-align:middle; white-space:normal; width:188pt\">The reinforced toe and heel caps extend boot life. The heel cap includes a molded fin strap keeper.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:60.0pt; vertical-align:middle; white-space:normal; width:188pt\">The long zipper is great for easy donning and doffing and is fitted with a gusset to cut down on water seepage.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:45.0pt; vertical-align:middle; white-space:normal; width:188pt\">The aggressive anti-slip tread is non-marking, a feature boat owners always appreciate.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:30.0pt; vertical-align:middle; white-space:normal; width:188pt\">Velcro zipper-end patch secures the side zipper when closed.</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:15.0pt; vertical-align:middle; white-space:nowrap\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:15.0pt; vertical-align:middle; white-space:nowrap\">Size : L</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 329, 'baik', 'alfian', '2023-07-27', 'R01.2', 27),
(492, 'DABN-TABC-008', 'BOOTISH CORAL BOOT', 1, 0, 'Unit', 0, 0, 0, '<p>Merk : Cressi</p>\r\n\r\n<p>&nbsp;Cressi isla ketebalan 3 mm<br />\r\n* Neoprene dive boot tahan lama nylon 2<br />\r\n* Terdapat dudukan boot untuk menahan strap fin agar tidak lepas<br />\r\n* Sol karet berusuk dan tahan lama<br />\r\n* Sangat cocok untuk diving,snorkling,hiking,olahraga layar,jalan-jalan di pantai dan yang lainya<br />\r\n* Neoprene super elastis kenyamanan ekstra<br />\r\n* Booting memberikan ketangguhan dan menjaga kehangatan</p>\r\n\r\n<p>Size : L<br />\r\n* Penutupan ritsleting yang kuat dan tahan lama<br />\r\n* Melindungi kaki dari karang<br />\r\n&nbsp;</p>\r\n', 329, 'baik', 'alfian', '2023-07-27', 'R01.2', 27),
(493, 'DABN-TABC-009', 'BOOTISH CORAL BOOT', 1, 0, 'Unit', 0, 0, 0, '<p>Merk : Zee Pro</p>\r\n\r\n<p>Zeepro 3mm low cut booties<br />\r\n3mm neoprene sandwiched between high quality,stretchy nylon fabric.<br />\r\nGlued and blind stitched seam to minimize water flow.<br />\r\nRecomended For Renting Purpose<br />\r\nTough, vulcanized rubber sole.<br />\r\nHeight : 10cm (4&quot;)</p>\r\n\r\n<p>Size : 10</p>\r\n', 329, 'baik', 'alfian', '2023-07-27', 'R01.2', 27),
(494, 'DABN-TABC-010', 'BOOTISH CORAL BOOT', 1, 0, 'Unit', 0, 0, 0, '<p>Merk : Amscud</p>\n\n<p>- Fiji 3.5mm AmScuD-Self Draining Boots&nbsp;</p>\n\n<p>- Fin Tab Prevents Strap Movement</p>\n\n<p>- Water Effortlessly Drains-Out Thru-Soles when Exiting the Water</p>\n\n<p>- Small Drain Holes throughout the Sole&nbsp;</p>\n\n<p>- Durable 3.5mm Nylon 2 Neoprene</p>\n\n<p>- Heavy Molded Sole</p>\n\n<p>- Durable Rubber Cap on Toe and Heel</p>\n', 329, 'baik', 'alfian', '2023-07-27', 'R01.2', 27),
(495, 'DABN-TABC-011', 'BOOTISH CORAL BOOT', 1, 0, 'Unit', 0, 0, 0, '<p>Merk : Zee Pro</p>\r\n\r\n<p>LONG BOOT ZEEPRO 5MM - BLACK<br />\r\nZeepro spandex lined boots.<br />\r\nAll boots double-glued and blind-stitched.<br />\r\nVulcanized rubber sole.<br />\r\nToe and heel caps for additional support and protection.<br />\r\nNo.10 ultra durable YKK zip.<br />\r\nReel zipper length close to bottom rubber (easy to use)</p>\r\n\r\n<p>Size : 4<br />\r\nCome with velcro to hold head zipper<br />\r\nDouble finishing around booties mouth<br />\r\nBuilt-in fin strap keeper on the back<br />\r\nLength 17cm<br />\r\nThickness 5mm</p>\r\n', 329, 'baik', 'alfian', '2023-07-27', 'R01.2', 27),
(496, 'DABN-TABC-012', 'BOOTISH CORAL BOOT', 1, 0, 'Unit', 0, 0, 0, '<p>Merk : Mares</p>\r\n\r\n<ul>\r\n	<li>Rubber grip soft sole.</li>\r\n	<li>2mm thick.</li>\r\n	<li>Lightweight and easy to pack.</li>\r\n	<li>Textured outsole for grip</li>\r\n	<li>size : 4</li>\r\n</ul>\r\n', 329, 'baik', 'alfian', '2023-07-27', 'R01.2', 27),
(497, 'DABN-TABC-013', 'BOOTISH CORAL BOOT', 1, 0, 'Unit', 0, 0, 0, '<p>Merk : OrcStar</p>\r\n\r\n<p>Size : 4</p>\r\n', 329, 'baik', 'alfian', '2023-07-27', 'R01.2', 27),
