(517, 'DABN-G-010', 'GLOBAL POSITIONING SYSTEM (GPS)', 1, 0, 'Unit', 0, 0, 0, '<p>Garmin 585+</p>\n\n<table>\n	<tbody>\n		<tr>\n			<td colspan=\"2\">\n			<h3>Physical &amp; Performance</h3>\n			</td>\n		</tr>\n		<tr>\n			<td>Physical dimensions</td>\n			<td>176.0 mm x 190.0 mm x 66.0 mm (6.93&rdquo; x 7.48&rdquo; x 2.60&rdquo;)</td>\n		</tr>\n		<tr>\n			<td>Display size, WxH</td>\n			<td>2.83&quot; x 5.36&quot;; 6.0&quot; diagonal (72.0 mm x 136.2 mm; 152.4 mm diagonal)</td>\n		</tr>\n		<tr>\n			<td>Display resolution, WxH</td>\n			<td>480 x 800 pixels</td>\n		</tr>\n		<tr>\n			<td>Display type</td>\n			<td>WVGA display</td>\n		</tr>\n		<tr>\n			<td>Weight</td>\n			<td>816.0 g (1.80 lbs)</td>\n		</tr>\n		<tr>\n			<td>Water rating</td>\n			<td>IPX7</td>\n		</tr>\n		<tr>\n			<td>GPS receiver</td>\n			<td>GPS/GLONASS/BeiDou, internal</td>\n		</tr>\n		<tr>\n			<td>NMEA 0183/RS422 compatible</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Power consumption</td>\n			<td>7.6 W</td>\n		</tr>\n		<tr>\n			<td>Voltage range</td>\n			<td>10V - 36V DC input</td>\n		</tr>\n		<tr>\n			<td>Mounting options</td>\n			<td>Bail or flush</td>\n		</tr>\n	</tbody>\n</table>\n\n<table>\n	<tbody>\n		<tr>\n			<td colspan=\"2\">\n			<h3>Maps &amp; Memory</h3>\n			</td>\n		</tr>\n		<tr>\n			<td>Preloaded maps</td>\n			<td>GPSMAP 585 Plus, APAC (worldwide basemap)<br />\n			GPSMAP 585 Plus, w/g2, SEA (built-in SEA g2 chart)</td>\n		</tr>\n		<tr>\n			<td>Accepts data cards</td>\n			<td>2 standard SD</td>\n		</tr>\n		<tr>\n			<td>Waypoints</td>\n			<td>12,000</td>\n		</tr>\n		<tr>\n			<td>Routes</td>\n			<td>200</td>\n		</tr>\n		<tr>\n			<td>Track log</td>\n			<td>one 50,000 points active track; 100 saved tracks</td>\n		</tr>\n	</tbody>\n</table>\n\n<table>\n	<tbody>\n		<tr>\n			<td colspan=\"2\">\n			<h3>Chartplotter Features</h3>\n			</td>\n		</tr>\n		<tr>\n			<td>Garmin Sonar compatible</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Supports AIS (tracks target ships position)</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Supports DSC (displays position data from DSC-capable VHF radio)</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Tide tables</td>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<table>\n	<tbody>\n		<tr>\n			<td colspan=\"2\">\n			<h3>Sonar Features &amp; Specifications</h3>\n			</td>\n		</tr>\n		<tr>\n			<td>Transmit power</td>\n			<td>600W (RMS)</td>\n		</tr>\n		<tr>\n			<td>Sonar Frequency</td>\n			<td>50/77/200kHz CHIRP (Low, Mid, High)</td>\n		</tr>\n		<tr>\n			<td>ClearV&uuml;&trade;</td>\n			<td>(built-in)</td>\n		</tr>\n		<tr>\n			<td>Scanning Sonar Frequency</td>\n			<td>CHIRP 260/455/800kHz</td>\n		</tr>\n		<tr>\n			<td>Maximum depth</td>\n			<td>2,300 ft, freshwater, 1,100 ft, saltwater (depth capacity is dependent on water bottom type and other water conditions)</td>\n		</tr>\n		<tr>\n			<td>Bottom lock (shows return from the bottom up)</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Water temperature log and graph</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Split-screen zoom</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Fish Symbol ID (helps identify fish targets)</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Sonar recording</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td>Sonar history rewind</td>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<table>\n	<tbody>\n		<tr>\n			<td colspan=\"2\">\n			<h3>Connections</h3>\n			</td>\n		</tr>\n		<tr>\n			<td>Transducer Connector Pin Numbers</td>\n			<td>8</td>\n		</tr>\n		<tr>\n			<td>8-Pin Power/NMEA 0183 Connector</td>\n			<td>1</td>\n		</tr>\n		<tr>\n			<td>BNC for External GPS Antenna</td>\n			<td>1</td>\n		</tr>\n	</tbody>\n</table>\n', 323, 'baik', 'andhika', '2023-07-27', 'R03.2', 27),
