(887, 'DABN-TSTE-001', 'TOP SET TRANSDUCER  ECHOSOUNDER', 1, 0, 'Unit', 0, 0, 0, '<p>FURUNO FE700 ECHOSOUNDER</p>\n\n<ul>\n	<li>Choice of 50 kHz or 200 kHz System Frequency (Menu Selectable)</li>\n	<li>600 Watt RMS Transceiver</li>\n	<li>6.5&Prime; Color TFT LCD Display with Wide Viewing Angle</li>\n	<li>Compact Display Unit, Enabling Installation at the Conning Position</li>\n	<li>Memory Storage and Recall of Depth Data for last 24 Hours</li>\n	<li>15 Minute Depth Data History may be viewed at any Range Scale</li>\n	<li>Digital Interface for Radar, VDR, ECDIS, and other Navigational Equipment</li>\n	<li>Customized Screen Modes for Simplified Presentation of Graphs and Data</li>\n	<li>Audio/Visual Alarms For Shallow Water, Lost Bottom, And Power Failure</li>\n	<li>DBS Mode Provides Draft Adjusted Depth Reading</li>\n	<li>Transfer of Sounding Data to a Personal Computer is Available with Optional I/F</li>\n	<li>8 Fixed Range Scales to a Max. of 800 Meters (Menu Selectable in Feet or Fathoms)</li>\n	<li>Maximum Range Offset to 1,600 Meters, 5,400 Feet or 900 Fathoms</li>\n	<li>Minimum Depth Readings: 0.5m (200 kHz), 2.0m (50 kHz)</li>\n	<li>Discrimination: 5.8mm per Meter Depth on 20m Range, 0.58mm on 200m Range</li>\n	<li>Compliant With IMO Standards MSC.74(69) Annex 4</li>\n	<li>Weights: Display Unit 4 kg, 8.8 lbs/Distribution Box 10 kg, 22.1 lbs</li>\n</ul>\n', 434, 'baik', 'andhika', '2023-09-12', 'RUANG TOOLS', 34),
(888, 'DABN-REE-001', 'ROTO ENCODER ELECTRIC QINSY', 1, 0, 'Unit', 0, 0, 0, '<p>Merk&nbsp; &nbsp;/&nbsp; Type&nbsp; :&nbsp; &nbsp;Autonics&nbsp; &nbsp;/&nbsp; E 80 H</p>\n\n<p>Power Supply : 5 VDC = +/- 5% (ripple P-P : max&nbsp; 5%), Output Volt&nbsp; &nbsp; &nbsp; ...&nbsp; &nbsp; &nbsp;12-24 VDC = +/- 5% (ripple P-P : max&nbsp;5%</p>\n\n<p>Output Phase : A, B, Z</p>\n\n<p>Inflow Current : max 30mA.&nbsp; &nbsp;Outflow Current : max 10mA</p>\n\n<p>Starting Torque : max 0.02&nbsp;Nm.&nbsp; &nbsp;Inertia Moment : max 800 g-cm</p>\n\n<p>Allowable Shaft Load : radial max 5 kgf, thrust max 2,5 kgf</p>\n\n<p>Unit Weight : 560 g</p>\n', 441, 'rusak', 'andhika', '2023-09-12', 'RUANG TOOLS', 27),
(889, 'DABN-GQ-001', 'GPS QINSY', 1, 0, 'Unit', 0, 0, 0, '<p>JRC / NWZ-4610</p>\n\n<table>\n	<tbody>\n		<tr>\n			<th>Name</th>\n			<th>Multi Info Display</th>\n		</tr>\n		<tr>\n			<th>Model</th>\n			<th>NWZ-4610</th>\n		</tr>\n		<tr>\n			<td>RoHS</td>\n			<td></td>\n		</tr>\n		<tr>\n			<td>Display unit</td>\n			<td>4.5-inch monochrome LCD (128 by 64 dots)</td>\n		</tr>\n		<tr>\n			<td>Backlight</td>\n			<td>White and orange LED selectable</td>\n		</tr>\n		<tr>\n			<td>Dimmer levels</td>\n			<td>Bright, medium, dark, off</td>\n		</tr>\n		<tr>\n			<td>Dimmer control</td>\n			<td>Keys or external control</td>\n		</tr>\n		<tr>\n			<td>Contrast</td>\n			<td>13 levels</td>\n		</tr>\n		<tr>\n			<td>Keys</td>\n			<td>12 (backlit) keys</td>\n		</tr>\n		<tr>\n			<td>Power supply voltage</td>\n			<td>10.8-31.2V DC (optional power supply 100-120V/200-240V AC)</td>\n		</tr>\n		<tr>\n			<td>Power consumption</td>\n			<td>Less than 2.5W</td>\n		</tr>\n		<tr>\n			<td>Alarm indication</td>\n			<td>Sound and/or LCD backlight color change</td>\n		</tr>\n		<tr>\n			<td>Display modes</td>\n			<td>6 (full screen, two sections, three sections, four sections, special, graphic)</td>\n		</tr>\n		<tr>\n			<td>Graphical display mode</td>\n			<td>Speed, Rudder angle, Wind direction, Water depth, Water temp</td>\n		</tr>\n		<tr>\n			<td>Selectable units</td>\n			<td>Speed/Wind: kn, km/h, mi/h, m/s, Temp: &deg;C, &deg;F, Distance: NM, km, mi, m, Depth: m, ft, fm</td>\n		</tr>\n		<tr>\n			<td>Interfacing</td>\n			<td>Power/Data: 12-24V DC, serial 3 in/output (RS-422), contact 1 in/output<br />\n			Data 1: serial 1 in/output (RS-485 ) for data/dimmer sharing<br />\n			Sensor/Data 2: serial 1 in/output (sensor) or daisy chain</td>\n		</tr>\n		<tr>\n			<td>NMEA0183 version</td>\n			<td>1.5, 2.1, 2.3, 4.0</td>\n		</tr>\n		<tr>\n			<td>Bit rate</td>\n			<td>RS-422: 4800, 9600, 19200, 38400<br />\n			RS-485: 38400, 57600, 76800, 115200</td>\n		</tr>\n		<tr>\n			<td>Data/dimmer share</td>\n			<td>NMEA data/dimmer share up to 10 units (RS-485)</td>\n		</tr>\n		<tr>\n			<td>Power distribution</td>\n			<td>Daisy chain up to 3 units</td>\n		</tr>\n		<tr>\n			<td>Languages</td>\n			<td>English, Japanese</td>\n		</tr>\n		<tr>\n			<td>Software update</td>\n			<td>Through PC</td>\n		</tr>\n		<tr>\n			<td>Diagnosis</td>\n			<td>ROM, RAM, serial ports, LCD, Buzzer</td>\n		</tr>\n		<tr>\n			<td>Demo mode</td>\n			<td>Built-in</td>\n		</tr>\n		<tr>\n			<td>Installation</td>\n			<td>Flush, Table</td>\n		</tr>\n		<tr>\n			<td>RMS</td>\n			<td>Available</td>\n		</tr>\n		<tr>\n			<td>Ambient conditions</td>\n			<td>Temperature: -15 to 55&deg;C (operating) -25 to 70&deg;C (storage)<br />\n			IP protection rate: IP55<br />\n			Relative humidity: 0% to 93% non-condensingsince</td>\n		</tr>\n	</tbody>\n</table>\n', 433, 'baik', 'andhika', '2023-09-12', 'RUANG TOOLS', 34),
