(961, 'DABN-GNSS-001', 'GNSS', 1, 0, 'Unit', 0, 0, 0, '<p>Magellan - MJ-3021-GM4-QZS</p>\n\n<p>Technology Advantage</p>\n\n<p>1. High-precision positioning algorithm with multiple frequencies using GPS, QZSS and GLONASS</p>\n\n<p>2. Receiver internal algorithm for outputting observation data capable of carrier positioning by GPS, QZSS L1 + L2 + L5</p>\n\n<p>3. Technology for performing actual PPP-RTK (high-precision independent positioning) calculation using the captured and tracked and decoded information in the Q6SS L6 band signal</p>\n\n<p>4. Elemental technology related to PPP-AR (solving integer bias of carrier phase like RTK), which has been attracting attention recently. Accuracy (horizontal RMS) improved from 10 cm to 2-3 cm compared to conventional PPP</p>\n\n<p>&nbsp;</p>\n\n<p>Spesifikasi</p>\n\n<table border=\"1\" cellspacing=\"0\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#3a3838; border-color:#9e9f9f; height:13.4pt; width:113.05pt\">\n			<p><strong>SPECIFICATION</strong></p>\n			</td>\n			<td colspan=\"3\" style=\"background-color:#3a3838; border-color:#9e9f9f; height:13.4pt; width:432.45pt\">\n			<p><strong>MJ-3021-GM4-QZS</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td rowspan=\"5\" style=\"background-color:#e6e9eb; border-color:#9e9f9f; height:10.6pt; width:113.05pt\">\n			<p><strong>Capture satellite/signal</strong></p>\n			</td>\n			<td style=\"height:10.6pt; vertical-align:top; width:5.0cm\">\n			<p>GPS</p>\n			</td>\n			<td colspan=\"2\" style=\"height:10.6pt; vertical-align:top; width:290.7pt\">\n			<p>L1,L2,L5</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:10.5pt; vertical-align:top; width:5.0cm\">\n			<p>QZSS</p>\n			</td>\n			<td colspan=\"2\" style=\"height:10.5pt; vertical-align:top; width:290.7pt\">\n			<p>L1,L2,L5,L6</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:10.5pt; vertical-align:top; width:5.0cm\">\n			<p>GLONASS</p>\n			</td>\n			<td colspan=\"2\" style=\"height:10.5pt; vertical-align:top; width:290.7pt\">\n			<p>G1, G2</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:10.5pt; vertical-align:top; width:5.0cm\">\n			<p>Galileo</p>\n			</td>\n			<td colspan=\"2\" style=\"height:10.5pt; vertical-align:top; width:290.7pt\">\n			<p>E1,E5a,E5,E6</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:10.5pt; vertical-align:top; width:5.0cm\">\n			<p>BeiDou</p>\n			</td>\n			<td colspan=\"2\" style=\"height:10.5pt; vertical-align:top; width:290.7pt\">\n			<p>B1,B3</p>\n			</td>\n		</tr>\n		<tr>\n			<td rowspan=\"6\" style=\"background-color:#e6e9eb; border-color:#9e9f9f; height:10.65pt; width:113.05pt\">\n			<p><strong>Position accuracy (RMS)</strong></p>\n			</td>\n			<td style=\"height:10.65pt; vertical-align:top; width:5.0cm\">\n			<p>Autonomous positioning</p>\n			</td>\n			<td colspan=\"2\" style=\"height:10.65pt; vertical-align:top; width:290.7pt\">\n			<p>1.5m (typical)</p>\n			</td>\n		</tr>\n		<tr>\n			<td rowspan=\"2\" style=\"height:10.5pt; vertical-align:top; width:5.0cm\">\n			<p>RTK (real-time kinematic)</p>\n			</td>\n			<td style=\"height:10.5pt; vertical-align:top; width:106.45pt\">\n			<p>dynamic</p>\n			</td>\n			<td style=\"height:10.5pt; vertical-align:top; width:184.25pt\">\n			<p>&lt;5cm+0.7ppm&times;Baseline (&lt;30km)</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:10.5pt; vertical-align:top; width:106.45pt\">\n			<p>static</p>\n			</td>\n			<td style=\"height:10.5pt; vertical-align:top; width:184.25pt\">\n			<p>&lt;0.5cm+0.7ppm&times;Baseline (&lt;30km)</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:10.5pt; vertical-align:top; width:5.0cm\">\n			<p>PPP (MADOCA) *2</p>\n			</td>\n			<td colspan=\"2\" style=\"height:10.5pt; vertical-align:top; width:290.7pt\">\n			<p>&lt;10 cm</p>\n			</td>\n		</tr>\n		<tr>\n			<td rowspan=\"2\" style=\"height:10.5pt; vertical-align:top; width:5.0cm\">\n			<p>PPP-RTK (CLAS) *3</p>\n			</td>\n			<td style=\"height:10.5pt; vertical-align:top; width:106.45pt\">\n			<p>dynamic</p>\n			</td>\n			<td style=\"height:10.5pt; vertical-align:top; width:184.25pt\">\n			<p>&lt;6.94 cm</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:10.5pt; vertical-align:top; width:106.45pt\">\n			<p>static</p>\n			</td>\n			<td style=\"height:10.5pt; vertical-align:top; width:184.25pt\">\n			<p>&lt;3.47 cm</p>\n			</td>\n		</tr>\n		<tr>\n			<td rowspan=\"4\" style=\"background-color:#e6e9eb; border-color:#9e9f9f; height:10.6pt; width:113.05pt\">\n			<p><strong>TTFF *1</strong></p>\n\n			<p><strong>(Autonomous)</strong></p>\n			</td>\n			<td style=\"height:10.6pt; vertical-align:top; width:5.0cm\">\n			<p>Cold start</p>\n			</td>\n			<td colspan=\"2\" style=\"height:10.6pt; vertical-align:top; width:290.7pt\">\n			<p>90 seconds (typical)</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:10.5pt; vertical-align:top; width:5.0cm\">\n			<p>Warm start</p>\n			</td>\n			<td colspan=\"2\" style=\"height:10.5pt; vertical-align:top; width:290.7pt\">\n			<p>35 seconds (typical)</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:10.5pt; vertical-align:top; width:5.0cm\">\n			<p>Hot start</p>\n			</td>\n			<td colspan=\"2\" style=\"height:10.5pt; vertical-align:top; width:290.7pt\">\n			<p>12 seconds (typical)</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"height:10.5pt; vertical-align:top; width:5.0cm\">\n			<p>Satellite reacquisition time</p>\n			</td>\n			<td colspan=\"2\" style=\"height:10.5pt; vertical-align:top; width:290.7pt\">\n			<p>4 seconds (typical)</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#e6e9eb; border-color:#9e9f9f; height:10.5pt; width:113.05pt\">\n			<p><strong>Size box</strong></p>\n			</td>\n			<td colspan=\"3\" style=\"height:10.5pt; vertical-align:top; width:432.45pt\">\n			<p>130 x 90 x 42 mm</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"background-color:#e6e9eb; border-color:#9e9f9f; height:10.6pt; width:113.05pt\">\n			<p><strong>Weight</strong></p>\n			</td>\n			<td colspan=\"3\" style=\"height:10.6pt; vertical-align:top; width:432.45pt\">\n