(2130, 'DABN-ETDR-001', 'ELECTRONIC TIME DOMAIN REFLECTOMETER', 1, NULL, 'Unit', 0, 0, 182, '<p>MEGGER - CFL535G</p>\r\n\r\n<p>Dual Channel capability<br />\r\nRange: Up to 20000m with a minimum resolution of 0.1m<br />\r\nAccuracy: &plusmn;1% of range<br />\r\nResolution: 0.3ft / 0.1m to 60kft / 20km<br />\r\nResolution: 1% of range<br />\r\nBacklit graphics color LCD (800x480) display<br />\r\nDesigned for use on all metallic paired cables</p>\r\n', 455, 'baik', 'andhika', '2023-12-22', 'JOINTER ROOM', 27),
(2131, 'DABN-IRT-001', 'INSULATION TESTER', 1, NULL, 'Unit', 0, 0, 181, '<h2>Fluke 1550C FC 5 kV Insulation Tester Kit</h2>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"3\">Electrical Specifications</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">The tester&#39;s accuracy is specified for one year after calibration at operating temperatures of 0&deg;C to 35&deg;C. For operating temperatures outside the range (-20&deg;C to 0&deg;C and 35&deg;C to 50&deg;C), add &plusmn; .25% per &deg;C, except on the 20% bands add &plusmn; 1% per &deg;C.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">Insulation Resistance Measurement</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">Test voltage (DC)</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"2\">250 V</td>\r\n			<td><strong>Range</strong></td>\r\n			<td>&lt; 250 k&Omega;,<br />\r\n			250 k&Omega; to 5 G&Omega;<br />\r\n			5 G&Omega; to 50 G&Omega;<br />\r\n			&gt; 50 G&Omega;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Accuracy (&plusmn; reading)</td>\r\n			<td>Unspecified<br />\r\n			5%<br />\r\n			20%<br />\r\n			Unspecified</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"2\">500 V</td>\r\n			<td><strong>Range</strong></td>\r\n			<td>&lt; 500 k&Omega;<br />\r\n			500 k&Omega; to 10 G&Omega;<br />\r\n			10 G&Omega; to 100 G&Omega;<br />\r\n			&gt; 100 G&Omega;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Accuracy (&plusmn; reading)</td>\r\n			<td>Unspecified<br />\r\n			5%<br />\r\n			20%<br />\r\n			Unspecified</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"2\">1000 V</td>\r\n			<td><strong>Range</strong></td>\r\n			<td>&lt; 1 M&Omega;<br />\r\n			1 M&Omega; to 20 G&Omega;<br />\r\n			20 G&Omega; to 200 G&Omega;<br />\r\n			&gt; 200 G&Omega;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Accuracy (&plusmn; reading)</td>\r\n			<td>Unspecified<br />\r\n			5%<br />\r\n			20%<br />\r\n			Unspecified</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"2\">2500 V</td>\r\n			<td><strong>Range</strong></td>\r\n			<td>&lt; 2.5 M&Omega;<br />\r\n			2.5 M&Omega; to 50 G&Omega;<br />\r\n			50 G&Omega; to 500 G&Omega;<br />\r\n			&gt; 500 G&Omega;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Accuracy (&plusmn; reading)</td>\r\n			<td>Unspecified<br />\r\n			5%<br />\r\n			20%<br />\r\n			Unspecified</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"2\">5000 V</td>\r\n			<td><strong>Range</strong></td>\r\n			<td>&lt; 5 M&Omega;<br />\r\n			5 M&Omega; to 100 G&Omega;<br />\r\n			100 G&Omega; to 1 T&Omega;<br />\r\n			&gt; 1 T&Omega;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Accuracy (&plusmn; reading)</td>\r\n			<td>Unspecified<br />\r\n			5%<br />\r\n			20%<br />\r\n			Unspecified</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Bar graph range</td>\r\n			<td colspan=\"2\">0 to 1 T&Omega; (1550C) - 0 to 2 T&Omega; (1555)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Insulation test voltage accuracy</td>\r\n			<td colspan=\"2\">-0%, +10% at 1 mA load current</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Induced AC mains current rejection</td>\r\n			<td colspan=\"2\">2 mA maximum</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Charging rate for capacitive load</td>\r\n			<td colspan=\"2\">5 seconds per &mu;F</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Discharge rate for capacitive load</td>\r\n			<td colspan=\"2\">1.5 s/&mu;F</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"2\">Leakage current measurement</td>\r\n			<td><strong>Range</strong></td>\r\n			<td>1 nA to 2 mA</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Accuracy</td>\r\n			<td>&plusmn;(5% + 2 nA)</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"2\">Capacitance measurement</td>\r\n			<td><strong>Range</strong></td>\r\n			<td>0.01 &mu;F to 15.00 &mu;F</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Accuracy</td>\r\n			<td>&plusmn;(15% rdg + 0.03 &mu;F)</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"3\">Timer</td>\r\n			<td><strong>Range</strong></td>\r\n			<td>0 to 99 minutes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Resolution setting</td>\r\n			<td>1 minute</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Resolution indication</td>\r\n			<td>1 second</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"2\">Live circuit warning</td>\r\n			<td><strong>Warning range</strong></td>\r\n			<td>30 V to 660 V AC/DC, 50/60 Hz</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Voltage accuracy</td>\r\n			<td>&plusmn;(15% + 2 V)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Software specifications</td>\r\n			<td colspan=\"2\">FlukeView Forms&trade; basic software requires a PC running Windows XP, Windows Vista , Windows 7 or Windows 8.</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">General Specifications</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Display</td>\r\n			<td colspan=\"2\">75 x 105 mm</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Power</td>\r\n			<td colspan=\"2\">12 V lead-acid rechargeable battery, Yuasa NP2.8-12</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Charger Input (AC)</td>\r\n			<td colspan=\"2\">85 V to 250 V AC 50/60 Hz 20 VA</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\">This Class II (double insulated) instrument is supplied with a Class 1 (grounded) power cord. The protective earth terminal (ground pin) is not connected internally. The extra pin is for added plug retention only.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Dimensions</td>\r\n			<td colspan=\"2\">269 x 277 x 160 mm (10.6 x 10.9 x 6.3 in)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Weight</td>\r\n			<td colspan=\"2\">3.7 kg (8.2 lb)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Temperature (operating)</td>\r\n			<td colspan=\"2\">-20&deg;C to 50&deg;C (-4&deg;F to 122&deg;F)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Temperature (storage)</td>\r\n			<td colspan=\"2\">-20&deg;C to 65&deg;C (-4&deg;F to 149&deg;F)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Humidity</td>\r\n			<td colspan=\"2\">80% to 31&deg;C decreasing linearly to 50% at 50&deg;C</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Altitude</td>\r\n			<td colspan=\"2\">2000 m</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Enclosure sealing</td>\r\n			<td colspan=\"2\">IP40</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Input overload protection</td>\r\n			<td colspan=\"2\">1000 V AC</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Electromagnetic compatibility</td>\r\n			<td colspan=\"2\">EN 61326</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Safety compliance</td>\r\n			<td colspan=\"2\">IEC 61010-1: Overvoltage category II, Pollution Degree 2.<br />\r\n			IEC 61010-2-030: Measurement 600V CAT IV / 1000V CAT III<br />\r\n			IEC 61557-1, IEC 61557-2</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 454, 'baik', 'andhika', '2023-12-22', 'JOINTER ROOM', 27),
